import React from 'react'
import {Link} from '@reach/router';

import{StyledNavigation} from '../styles/StyledNavigation'

const Navigation=()=>(
    <StyledNavigation>
        <div className="navigation-content">
            <Link to="/">
            <p>Home</p>
            </Link>
        </div>
    </StyledNavigation>
);


export default Navigation;
